import React, {Component} from 'react'


class Profil extends Component{
  
    render(){
      return(
        <div>
          <img src={this.props.coordonee.imgSrc} alt='logo'/>
          <h1>{this.props.coordonee.fullName}</h1>
          <p>{this.props.coordonee.bio}</p>
          <p>{this.props.coordonee.profession}</p>
        </div>
      )
      
    }
  }

export default Profil
